import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { NavBarButtonComponent } from './nav-bar-button/nav-bar-button.component';
import { NavBarComponent } from './nav-bar/nav-bar.component';
import { WelcomeTextComponent } from './welcome-text/welcome-text.component';
import { DashboardPanelComponent } from './dashboard-panel/dashboard-panel.component';
import { DashboardContentComponent } from './dashboard-content/dashboard-content.component';
import { DashboardContent2Component } from './dashboard-content2/dashboard-content2.component';
import { StreakTextComponent } from './streak-text/streak-text.component';
import { StreakPanelComponent } from './streak-panel/streak-panel.component';
import { StreakContentComponent } from './streak-content/streak-content.component';
import { MyProfileComponent } from './my-profile/my-profile.component';
import { MyProfilePanelComponent } from './my-profile-panel/my-profile-panel.component';
import { TeamDashboardTextComponent } from './team-dashboard-text/team-dashboard-text.component';
import { TeamDashboardPanelComponent } from './team-dashboard-panel/team-dashboard-panel.component';
import { TeamDashboardComponentComponent } from './team-dashboard-component/team-dashboard-component.component';

@NgModule({
  declarations: [
    AppComponent,
    NavBarButtonComponent,
    NavBarComponent,
    WelcomeTextComponent,
    DashboardPanelComponent,
    DashboardContentComponent,
    DashboardContent2Component,
    StreakTextComponent,
    StreakPanelComponent,
    StreakContentComponent,
    MyProfileComponent,
    MyProfilePanelComponent,
    TeamDashboardTextComponent,
    TeamDashboardPanelComponent,
    TeamDashboardComponentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
